        //     <h4>{babysitter ? babysitter.phone_number : null}</h4>
        //     <u>Slots: </u><SlotsContainer babysitter={babysitter} />
        //     <br/>
        //     <u>Comments: </u><CommentsContainer babysitter={babysitter}/>
        // </div>
    )
}

export default BabysitterShow
